import { Link } from 'react-router-dom'

let getTitle = ({ note })=>{}

const ListItem = ({ note }) => {
  return (
    <Link to={`/note/${note.id}`}> 
    <div className='notes-list-item'>
      
        <h3>{note.body}</h3>
    </div>
    </Link>
  )
}

export default ListItem
